import React, { useState, useEffect } from 'react';

const ContractInput = ({ onContractChange, initialContract = '' }) => {
  // Define state variables
  const [level, setLevel] = useState('');
  const [suit, setSuit] = useState('');
  const [declarer, setDeclarer] = useState('');
  const [doubled, setDoubled] = useState('');
  
  // Parse initialContract if provided
  useEffect(() => {
    if (initialContract) {
      const contractMatch = initialContract.match(/(\d)([♣♦♥♠]|NT)\s+([NESW])(X{0,2})/);
      if (contractMatch) {
        setLevel(contractMatch[1]);
        setSuit(contractMatch[2]);
        setDeclarer(contractMatch[3]);
        setDoubled(contractMatch[4] || '');
      }
    }
  }, [initialContract]);
  
  // Update contract when any component changes
  useEffect(() => {
    if (level && suit && declarer) {
      const newContract = `${level}${suit} ${declarer}${doubled}`;
      onContractChange(newContract);
    }
  }, [level, suit, declarer, doubled, onContractChange]);
  
  // Handle level selection
  const handleLevelClick = (selectedLevel) => {
    setLevel(selectedLevel);
  };
  
  // Handle suit selection
  const handleSuitClick = (selectedSuit) => {
    setSuit(selectedSuit);
  };
  
  // Handle declarer selection
  const handleDeclarerClick = (selectedDeclarer) => {
    setDeclarer(selectedDeclarer);
  };
  
  // Handle doubled selection - THIS IS THE KEY CHANGE
  const handleDoubledClick = (selectedDoubled) => {
    setDoubled(selectedDoubled);
  };

  // Style functions for suits - Using inline styles to ensure they override
  const getSuitStyle = (s) => {
    let style = {
      flex: 1,
      height: '50px',
      border: '1px solid #ddd',
      backgroundColor: suit === s ? '#3498db' : '#f8f8f8',
      borderRadius: '8px',
      fontSize: '28px',
      fontWeight: 'bold',
      cursor: 'pointer',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      color: suit === s ? 'white' : (s === '♥' || s === '♦' ? '#e74c3c' : (s === 'NT' ? '#2c3e50' : '#000'))
    };
    
    return style;
  };
  
  // Style for selected buttons
  const getSelectedStyle = (value, currentValue) => {
    return {
      backgroundColor: value === currentValue ? '#3498db' : '#f8f8f8',
      color: value === currentValue ? 'white' : 'black',
      borderColor: value === currentValue ? '#3498db' : '#ddd',
      flex: 1,
      height: '50px',
      border: '1px solid #ddd',
      borderRadius: '8px',
      fontSize: '20px',
      fontWeight: 'bold',
      cursor: 'pointer',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center'
    };
  };
  
  return (
    <div className="contract-input-container">
      {/* Level Input */}
      <div className="level-suit-section">
        <div className="input-section-label">Level and Suit:</div>
        
        {/* Level Buttons (1-7) */}
        <div className="level-buttons">
          {[1, 2, 3, 4, 5, 6, 7].map((num) => (
            <button
              key={`level-${num}`}
              style={getSelectedStyle(num.toString(), level)}
              onClick={() => handleLevelClick(num.toString())}
              data-level={num}
            >
              {num}
            </button>
          ))}
        </div>
        
        {/* Suit Buttons */}
        <div className="suit-buttons">
          {['♣', '♦', '♥', '♠', 'NT'].map((s) => (
            <button
              key={`suit-${s}`}
              style={getSuitStyle(s)}
              onClick={() => handleSuitClick(s)}
              data-suit={s}
            >
              {s}
            </button>
          ))}
        </div>
      </div>
      
      {/* Declarer Input */}
      <div className="declarer-section">
        <div className="input-section-label">Declarer:</div>
        <div className="declarer-buttons">
          {['N', 'S', 'E', 'W'].map((d) => (
            <button
              key={`declarer-${d}`}
              style={getSelectedStyle(d, declarer)}
              onClick={() => handleDeclarerClick(d)}
            >
              {d}
            </button>
          ))}
        </div>
      </div>
      
      {/* Doubled Input - Updated to allow selection without dependencies */}
      <div className="doubled-section">
        <div className="input-section-label">Doubled:</div>
        <div className="doubled-buttons">
          <button
            style={getSelectedStyle('', doubled)}
            onClick={() => handleDoubledClick('')}
          >
            -
          </button>
          <button
            style={getSelectedStyle('X', doubled)}
            onClick={() => handleDoubledClick('X')}
          >
            X
          </button>
          <button
            style={getSelectedStyle('XX', doubled)}
            onClick={() => handleDoubledClick('XX')}
          >
            XX
          </button>
        </div>
      </div>
    </div>
  );
};

export default ContractInput;
